function Projects() {
    const projects = [
      { name: 'Who Got Invested In?', url: 'https://example.com/project1' },
      { name: 'Voxxy AI', url: 'https://example.com/project2' },
      { name: 'MCAT Quiz Guide', url: 'https://example.com/project3' },
    ];

    return (
      <div className="projects">
        <h1>My Projects</h1>
        <ul>
          {projects.map((project, index) => (
            <li key={index}>
              <a href={project.url} target="_blank" rel="noopener noreferrer">
                {project.name}
              </a>
            </li>
          ))}
        </ul>
      </div>
    );
  }

  export default Projects;
